import React from 'react';
import './style.css';

function Contact () {
  return (
    <div>
      <h1 id="contact" className='body-section-header'>Contact</h1>
      <p className='body-text'>
        <a className="grey-link" href="https://www.linkedin.com/in/neilprajapati">LinkedIn</a>
      </p>

    </div>
  );
}

export default Contact;
